import React, { useEffect, useState } from 'react';
import { getParkingLogs, logVehicleEntry, logVehicleExit } from '../services/apiService';

const ParkingLog = () => {
  const [logs, setLogs] = useState([]);
  const [licensePlate, setLicensePlate] = useState('');

  useEffect(() => {
    fetchLogs();
  }, []);

  const fetchLogs = async () => {
    try {
      const data = await getParkingLogs();
      setLogs(data);
    } catch (err) {
      console.error('Error fetching logs:', err);
    }
  };

  const handleEntry = async () => {
    try {
      const response = await logVehicleEntry({ licensePlate });
      alert(response.message);
      fetchLogs();
    } catch (err) {
      console.error('Error logging entry:', err);
      alert('Error logging vehicle entry');
    }
  };

  const handleExit = async () => {
    try {
      const response = await logVehicleExit({ licensePlate });
      alert(`Vehicle exited: ${response.message}, Fee: ${response.fee}`);
      fetchLogs();
    } catch (err) {
      console.error('Error logging exit:', err);
      alert('Error logging vehicle exit');
    }
  };

  return (
    <div>
      <h2>Parking Logs</h2>
      <div>
        <input
          type="text"
          placeholder="License Plate"
          value={licensePlate}
          onChange={(e) => setLicensePlate(e.target.value)}
        />
        <button onClick={handleEntry}>Entry</button>
        <button onClick={handleExit}>Exit</button>
      </div>
      <table border="1" style={{ width: '100%', textAlign: 'center', borderCollapse: 'collapse' }}>
        <thead>
          <tr>
            <th>License Plate</th>
            <th>Entry Time (Nepal Time)</th>
            <th>Slot Number</th>
            <th>Exit Time</th>
            <th>Fee (NPR)</th>
          </tr>
        </thead>
        <tbody>
          {logs.map((log, index) => (
            <tr key={index}>
              <td>{log.licensePlate}</td>
              <td>{log.entryTime}</td>
              <td>{log.slotNumber}</td>
              <td>{log.exitTime}</td>
              <td>{log.fee}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ParkingLog;
